import * as TYPES from './Actions/actionTypes.js';

const initialState = {
  employeeToken: 'you dont need a token',
  mensHaircut: false,
  modalOpen: true,
  clientsList: '',
  activeId: '',
};

export default function reducer(state = initialState, action) {
  switch (action.type) {
    case TYPES.ACTIVE_ID_SET:
      console.log('hello from reducer', action.payload);
      return {
        ...state,
        activeId: action.payload,
      };
    case TYPES.CLIENTS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
        clientsList: action.payload,
      };

    case TYPES.EMPLOYEE_AUTORIZATION_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
        employeeToken: action.payload,
        modalOpen: false,
      };

    case TYPES.MATERIALS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.SERVICES_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.ORDERS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.SHCEDULES_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.PROMOS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.PROFILES_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.FEEDBACKS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.SPECIALIZATIONS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    case TYPES.STAFFS_FETC_DATA_SUCCESS:
      // console.log(action.payload);
      return {
        ...state,
      };

    default:
      return state;
  }
}
